import React from 'react';

export default function User( {name, age, image, city} ) {
    
  return (
    <div className='user'>
       
      <h2>{name}</h2>
      <h3>{age}</h3>
      <img src={image}/>
      <h3>{city}</h3>
    </div>
  );
}
